                    "_id": "1.1.35",
                    "text": "And many limits of the charge set down"
                }]
            }]
        }]
    }]
}
</code></pre>

<p>How can I get results ordered by "lines" count and also have the parent nodes attributes? The ideal result would look something like this:</p>

