nestjs different beetween mongoose model provider and MongooseModule.forFeature<p>when I start to connect my nestjs app to MongoDB I see 2 different approaches for that
1- use MongooseModule.forFeature
2- use provider
in the first approach we have module like this</p>

<pre><code>@Module({
    imports: [
        MongooseModule.forFeature([{name: "COMPANY_MODEL", schema: CompanySchema}]),
        DatabaseModule
    ],
    controllers: [CompanyController],
    providers: [CompanyService,CityStateService],
})
</code></pre>

<p>and use InjectModel in service:</p>

<pre><code>constructor(
        @InjectModel("COMPANY_MODEL")
        private companyModel: Model&lt;ICompany&gt;) { }
</code></pre>

<p>in a secend approach we have extra file <code>company.provider.ts</code> that contain:</p>

<pre><code>export const CompanyProviders = [
    {
        provide: "COMPANY_MODEL",
        useFactory: (connection: Connection) =&gt; connection.model("Company", CompanySchema),
        inject: ["DATABASE_CONNECTION"],
    },
];
</code></pre>

<p>and we provide it in module like:</p>

<pre><code>@Module({
    imports: [
        DatabaseModule
    ],
    controllers: [CompanyController],
    providers: [CompanyService,CityStateService,...CompanyProviders],
})
export class CompanyModule { }
</code></pre>

<p>and in service we use simple Inject:</p>

<pre><code>constructor(
            @Inject("COMPANY_MODEL")
            private companyModel: Model&lt;ICompany&gt;) { }
</code></pre>

<p>i wonder what is the different between these 2 approach in nestjs and which one is better?</p>

