<p>Inside the try catch block I have manually thrown the error (throw new Error('ssomlk caused manual error');) so I could try to test whether the transaction works.</p>

<pre><code>const session = await mongoose.startSession();
session.startTransaction();
try {
  await ticket.save({ session });
  throw new Error('ssomlk caused manual error');
  await new TicketCreatedPublisher(natsWrapper.client).publish({
    id: ticket.id,
    title: ticket.title,
    price: ticket.price,
    createdBy: ticket.createdBy,
  });
  await session.commitTransaction();
  session.endSession();
  res.status(201).send(ticket);
} catch (error) {
  session.abortTransaction();
  session.endSession();
  console.log(error);
  res.status(401).send({ error: error.message });
