alternative to using 'await' with lazy_static! macro in rust?<p>I want to use Async MongoDB in a project.</p>
<p>I don't want to pass around the client because it would need to go around multiple tasks and threads. So I kept a static client using <code>lazy_static</code>. However, I can't use <code>await</code> in the initialization block.</p>
<p>What can I do to work around this?</p>
<p>Suggestions for doing it without <code>lazy_static</code> are also welcome.</p>
<pre><code>use std::env;
use futures::stream::StreamExt;
use mongodb::{
    bson::{doc, Bson},
    options::ClientOptions,
    Client,
};

lazy_static! {
    static ref MONGO: Option&lt;Client&gt; = {
        if let Ok(token) = env::var(&quot;MONGO_AUTH&quot;) {
            if let Ok(client_options) = ClientOptions::parse(&amp;token).await
                                                                     ^^^^^
            {
                if let Ok(client) = Client::with_options(client_options) {
                    return Some(client);
                }
            }
        }
        return None;
    };
}
</code></pre>

